<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Movies in Brazil</title>
    <style>
        /* 기존 스타일 코드 유지 */
        body {
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: flex-start;
            padding: 20px;
        }

        .dropdown-container {
            position: absolute;
            top: 20px;
            left: 20px;
            z-index: 1000;
        }

        .dropdown {
            padding: 10px;
            font-size: 16px;
            cursor: pointer;
        }

        .visualization-container {
            display: flex;
            justify-content: space-between;
            width: 100%;
            max-width: 1200px;
            margin: 20px 0;
        }

        .visualization-section {
            flex: 1;
            padding: 20px;
            box-sizing: border-box;
            text-align: center;
            margin: 0 10px;
        }

        .movie-container {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 20px;
        }

        .movie-container img {
            width: 150px;
            height: 200px;
            object-fit: cover;
            border: 1px solid #ccc;
            border-radius: 8px;
        }

        /* 시각화 콘텐츠에 이미지 크기 맞추기 */
        .visualization-section img {
            width: 100%;
            height: auto;
        }
    </style>
</head>

    <!-- 드롭다운 메뉴 -->
    <div class="dropdown-container">
        <select id="countryDropdown" class="dropdown" onchange="updateMovies(this.value)">

            <option value="Brazil" selected>Brazil</option>
            <option value="United States" >United States</option>
            <option value="United Kingdom" >United Kingdom</option>
            <option value="Australia" >Australia</option>
            <option value="South Africa" >South Africa</option>
        </select>
    </div>

    <script>
        function updateMovies(countryName) {
            // API 호출
            fetch(`/movies/${countryName}/`)
                .then(response => response.json())
                .then(data => {
                    // 서버로부터 받은 데이터로 페이지 업데이트
                    document.getElementById('countryName').innerText = countryName;
                    document.getElementById('movieCards').innerHTML = data.movie_cards;
                    document.getElementById('wordcloudImage').src = 'data:image/png;base64,' + data.wordcloud_image;
                    document.getElementById('piechartImage').src = 'data:image/png;base64,' + data.piechart_image;
                    document.getElementById('averageRating').innerText = 'Average Rating: ' + data.average_rating;
                    document.getElementById('starsSvg').innerHTML = data.stars_svg;

                    // 페이지 제목과 URL을 업데이트
                    document.title = `Top Movies in ${countryName}`;
                    window.history.pushState({}, '', `/movies/${countryName}/`);
                })
                .catch(error => {
                    console.error('Error fetching movie data:', error);
                });
        }
    </script>
